def find_second_largest():
    import sys
    input = sys.stdin.read
    data = input().split()

    N = int(data[0])
    A = list(map(int, data[1:]))

    if N < 2:
        raise ValueError("N must be at least 2")

    first_max = float('-inf')
    second_max = float('-inf')

    for num in A:
        if num > first_max:
            second_max = first_max
            first_max = num
        elif num > second_max:
            second_max = num

    # Find the index of the second largest element
    for i, num in enumerate(A):
        if num == second_max:
            print(i + 1)
            break

